import Hombre1 from '../public/Hombre1'
import Hombre2 from '../public/Hombre2'
import Hombre3 from '../public/Hombre3'
import Hombre4 from '../public/Hombre4'

export default class extends React.Component{
    render(){
        return(
            <div className='container-fluid'>
                <div className='row'>
                    <div className='col-lg-6 col-md-6 col-sm-12 separarContenedor'>
                        <Hombre1/> 
                    </div>
                    <div className='col-lg-6 col-md-6 col-sm-12 separarContenedor'>
                        <div className='row'>
                            <div className='col-lg-3 col-md-3 separarContenedor'>
                                <Hombre2/>
                            </div>
                            <div className='col-lg-3 col-md-3'>
                                <Hombre3/>
                            </div>
                        </div>
                        <div row>
                            <div className='col-lg-3 col-md-3 img img1'>
                                <Hombre4/>
                            </div>
                        </div>
                    </div>
                </div>
                <style jsx>
                    {`
                        .separarContenedor{
                            margin-top: 50px;
                            margin-right: -50px;
                        }
                        .img{
                            margin-right: 180px;
                        }
                        .img1{
                            margin-top: 30px;
                        }
                    `}
                </style>
            </div>
        );
    }
}
